// SPDX-License-Identifier: MIT
pragma solidity ^0.8.26;

interface myInterface {
    function sup() external returns(string memory);
}
contract Sup {
    function sup2() virtual external returns(string memory) {}
}

contract MyContract is Sup {
   function sup2() override  external pure returns(string memory) {
        return "Sup biches";
    }
    function sup(address _addr) public {
        myInterface(_addr).sup();
    }

}

